@SauloVital_ @NathyCouto Hômi! Deixa de se enganar.
Ciro só tem voto no Ceará e por enquanto...
A estratégia dele é suicida: perde a simpatia da esquerda e não seduz a nova direita. Vai morrer com os mesmos 8% cativo desde o início dos anos 2000.

@salocinuy 1. No era una metralleta, era una escopeta
2. No era una masacre, era un intento suicida
3. Quieren ayudar a mejorar la salud mental de esa persona, ni difundan el video, muestren la foto del entrenador con un texto con lo sucedido, el hacerlo viral solo empeora su salud mental

@SissyRibs @taiguara_sousa @jairbolsonaro Ata. Se um grupo de direita matou gente há 40 anos, isso justifica um grupo de esquerda matar gente hoje.

Totalmente justificável.

O fato é que isso é uma reação da esquerda que perdeu as eleições em TODA a América Latina (exceto Bolívia e Venezuela por motivos óbvios).

@ThatuNunes Um dos meus melhores amigos se matou.
Eu e o resto dos amigos íntimos passamos quase uma década preocupados, tentando ajudar...e depois, carregando a culpa do "podia ter feito mais".

Pra ouvir coachzinho me falar pra eu "lembrar de quem é positivo NA PROXIMA que alguem se matar"

